import React, { useEffect } from 'react'
import axios from 'axios'

const Sensor = () => {
    
    const loadSensor = async () => {
        await axios.get('http://localhost:3000/api/sensor')
    }

    useEffect(() => {
        loadSensor()
    }, [])

    return (
        <div>
            Hello World!!!
        </div>
    )
}

export default Sensor
